                        <Box fontWeight={700} fontSize={24} marginTop={10}>คำถามที่พบบ่อย</Box>
                        <Divider />
                    </Grid>

                    <Grid item>
                        <QuestionBox id={0} question="คำถาม" answer="คำตอบ" />


                    </Grid>



                </Grid>
            </Container>

        </>
    );
}
